import "./../css/Register.css";
import axios from "axios";


class loging extends React.Component{

  constructor(props) 
  {
    super(props);
    this.state = {
      username: "",
      passw: "aa"
    };
  }

  componentDidMount() { 
    let data; 

    axios 
        .get("http://localhost:8000/wel2/") 
        .then((res) => { 
            data = res.data; 
            this.setState({ 
                details: data, 
            }); 
        }) 
        .catch((err) => {}); 
  } 


  handle_Change_user_name(event)
  {
    this.setState( (state, props) =>{
      return{
        username: event.target.value
      };
      })
      console.log(this.state.username);
  }

  handle_Change_pass(event)
  {
    // this.setState( (state, props) =>{
    //   return{
    //    passw: event.target.value
    //   };
    //   })
    // console.log(event.target.value)
    this.state.passw = event.target.value
    console.log(this.state.passw);
  }

  OnSubmit(e)
  {
    e.preventDefault();
    console.log(this.state.passw)
    // if((this.state.passw.length > 1) && (this.state.length > 1))
    // {
    //   console.log("Submit happen")
    // }
    // else
    // {
    //   console.log("Submit NOT happen")
    // }

  }


  render()
  {



    return (
        <div className="App">
          <header className="App-header">
            <div className="reg_box">
              <p className="reg_text0"> Sign in </p>
              <p className="reg_text0"> {this.state.passw} </p>
              <form>

                  <div className="reg_box2">
                    <div className="reg_box3">
                      <div className="reg_text">UserName: </div>
                    </div>
                    <div className="reg_box3">
                      <input className="reg_Base2" type="text"  placeholder = "Name..."  name="username" 
                            value={this.state.username} onChange={this.handle_Change_user_name} />
                    </div>
                  </div>

                  <div className="reg_box2">
                    <div className="reg_box3">
                      <div className="reg_text">Password: </div>
                    </div>
                    <div className="reg_box3">
                      <input className="reg_Base2" type="text"  placeholder = "passw..."  name="passw"  
                              value={this.state.passw} onChange={this.handle_Change_pass}/>
                    </div>
                  </div>

                  <button type="submit" className="btn btn-primary mb-5" onClick={this.OnSubmit}> Submit </button>
                </form>
              </div>
            </header>
          </div>
              );
        }
}

export default loging;
